import styled from "styled-components";

const TodoGrid = styled.section`
    display: grid;
    width: 100%;
    grid-template-columns: repeat(4, 1fr);
    gap:10px;
`

const TodoBox = styled.div`
    display: flex;
    justify-content: center;
    flex-direction: column;
    min-height: 70px;
    border: 1px black solid;
    border-radius: 10px;
    background-color: white;
`

const TodoText = styled.div`
    text-align: center;
    background-color: white;
`

const DelBtn = styled.button`
    position: absolute;
    width: 40px;
    height: 25px;
    border-radius: 10px;
    text-align: center;
    background-color: white;
    right:200px;
    :hover{
        background-color: #EFEFEF;
    }
`

function Todo () {

    return (
        <TodoGrid>
            <TodoBox>
                <TodoText> 1. C </TodoText>
                <DelBtn> DEL</DelBtn>
            </TodoBox>
            <TodoBox>
                <div> 2. D </div>
            </TodoBox>
            <TodoBox>
                <div> 3. U </div>
            </TodoBox>
            <TodoBox>
                <div> 4. Design </div>
            </TodoBox>
            <TodoBox>
                <div> 나는 투두에오 </div>
            </TodoBox>
        </TodoGrid>
    )
}

export default Todo;
